script: |
  super -f text -I q1252.spq | sort > q1252.out

inputs:
  - name: q1252.spq
    data: |
      SELECT DISTINCT - + cor0.col0 * col1 + - ( - 33 ) * + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q1252.out
    data: |
      -1272
      -2240
      -5162
